import { GenericPlant } from './'

 export default function getSeed(seed) {

   switch(seed) {
     case "generic_plant":
        return {bloom: 1, leafColour: '#ff006e', stemColour: '#ffbe0b', flowerColour: '#55dde0'}
     case "tulip":
        return {bloom: 2, leafColour: '#A2A84B', stemColour: '#4D5319', flowerColour: '#D9D08F'}

     default:
      return
   }

}
